package com.anders.vote.dao;import java.util.Set;import org.junit.Test;import org.junit.runner.RunWith;import org.unitils.UnitilsJUnit4;import org.unitils.UnitilsJUnit4TestClassRunner;import org.unitils.dbunit.annotation.DataSet;import org.unitils.dbunit.datasetloadstrategy.impl.CleanInsertLoadStrategy;import org.unitils.spring.annotation.SpringApplicationContext;import org.unitils.spring.annotation.SpringBean;import com.anders.vote.bo.Url;import com.anders.vote.dao.UrlDao;@RunWith(UnitilsJUnit4TestClassRunner.class)@SpringApplicationContext("classpath:applicationContext-test.xml")@DataSet(loadStrategy = CleanInsertLoadStrategy.class)public class UrlDaoTest extends UnitilsJUnit4 {	@SpringBean(value = "urlDao")	private UrlDao urlDao;	@Test	@DataSet("UrlDaoTest.xml")	public void testGetAllFetchRoles() {		Set<Url> urls = urlDao.getAllFetchRoles();		for (Url url : urls) {			System.out.println(url.getName());		}	}}